"use strict";
// 在类中的动态运行时 this
// TypeScript 不会改变 JavaScript 的运行时行为
class MyClass {
    constructor() {
        this.name = "MyClass";
    }
    getName() {
        return this.name;
    }
}
const c = new MyClass();
const obj = {
    name: "obj",
    getName: c.getName,
};
// Prints "obj", not "MyClass"
console.log(obj.getName());
